import  React  from  'react';
import CoolTabs from 'react-cool-tabs';
import Home from './Pages/Home';
import CreateCalendar from './Pages/CreateCalendar';
import DeleteCalendar from './Pages/DeleteCalendar';
import UpdateCalendar from './Pages/UpdateCalendar';

function App() {
  return (

    <div>
	     <CoolTabs
	       tabKey={'3'}
	       style={{ width:  550, height:  500, background:  'white' }}
	       activeTabStyle={{ background:  'red', color:  'white' }}
	       unActiveTabStyle={{ background:  'green', color:  'black' }}
	       activeLeftTabBorderBottomStyle={{ background:  'blue', height:  4 }}
	       activeRightTabBorderBottomStyle={{ background:  'yellow', height:  4 }}
	       tabsBorderBottomStyle={{ background:  'orange', height:  4 }}

	       homeTab={'Home'}
	       updateCalendarTab={'Update Calendar'}
         deleteCalendarTab={'Delete Calendar'}
         createCalendarTab={'Create Calendar'}

	       homeTab={<Home/>}
         updateCalendarTab={<UpdateCalendar/>}
         deleteCalendarTab={<DeleteCalendar/>}
         createCalendarTab={<CreateCalendar/>}



	       contentTransitionStyle={'transform 0.6s ease-in'}
	       borderTransitionStyle={'all 0.6s ease-in'}/>
     </div>
  );
}

export default App;
